### JavaScript

```javascript
"use strict";

function f_gold(s) {
    let q = [];
    let parentheses = new Set(['()', '[]', '{}']);
    for (let ch of s) {
        if (ch === '(' || ch === '[' || ch === '{') {
            q.push(ch);
        } else if (!q || !parentheses.has(q.pop() + ch)) {
            return false;
        }
    }
    return !q.length;
}
```
